actionConfiguration.body:
()=>{		
		if(Input_VesselID.text==""){
			showAlert("Installation ID is required");
		}
		else{
			let buildPayload = {};
			buildPayload = {
				"vesselId": Input_VesselID.text,
				"behaviour": AddBehaviour.selectedOptionValue,
				"start": (AddStart.text==""?null:AddStart.text),
				"end": (AddTo.text==""?null:AddTo.text)
			}
			storeValue("key_AddBehaviour_Payload",buildPayload)

			CreateVesselBehaviour.run(
				//success	
				() => {storeValue("key_AddBehaviour_AddAPIFail","");JSObject1.GetVesselBehaviours();closeModal('ModalAdd')},
				//fail
				() => {showAlert("Something went wrong - New Vessel Behaviour not inserted"); storeValue("key_AddBehaviour_AddAPIFail", CreateVesselBehaviour.data.message)}
			)			
		}
	}

